Mongoose findOne Returns Null Object Value<p>I have saved some documents in mongodb compass successfully. I am trying to retrieve the values by querying some of the parameters. </p>

<p>I understand that mongodb findOne has arguments such as 
<code>query, fields(by default value: all), options and callback</code>
 but the result of the operation returns null and throws a type error.</p>

<p>Here's my code:</p>

<pre><code>router.get('/edit-page/:slug',(req,res) =&gt; {
  console.log('slug:\t' + req.params.slug);
  Pages.findOne({slug: req.params.slug},(errs, page) =&gt; {
    if(errs){
      req.flash('danger', 'page not found');
      console.error(errs);
    } else {
      console.log(page);
      res.render('admin/edit_page',{
        title: page.title,
        slug: slug,
        content: page.content,
        id: page._id
      });
    }
  });
});
</code></pre>

<p>copy of my data structure in mongo compass:</p>

<pre><code>{   
  "_id":"5a9568fa5ce418423ca8e29f",
  "title":"Home",
  "slug":"home",
  "content":"Home Page for Node CMS Cart",
  "sorting":100,
  "__v":0
}
</code></pre>

<p>Error Thrown:</p>

<pre><code>GET /admin/routes 200 8.634 ms - 3064
slug:    about-us
null
events.js:183
     throw er; // Unhandled 'error' event
     ^

TypeError: Cannot read property 'title' of null
    at Pages.findOne (E:\nodeCMSApp\routes\admin_routes.js:98:29)
    at model.Query.&lt;anonymous&gt; 
(E:\nodeCMSApp\node_modules\mongoose\lib\model.js:3928:16)
    at E:\nodeCMSApp\node_modules\kareem\index.js:297:21
    at E:\nodeCMSApp\node_modules\kareem\index.js:135:16
    at _combinedTickCallback (internal/process/next_tick.js:131:7)
    at process._tickCallback (internal/process/next_tick.js:180:9)
[nodemon] app crashed - waiting for file changes before starting...
</code></pre>

<p>I dont seem to understand why in my callback, I can't get a reference to <code>page.title</code> as the default fields when not specified is all fields.</p>

<p>PS: Pages is my model class.</p>

<p>How do I work around this problem, if it is?
Thanks.</p>

