/* 2 */
{
    "_id" : ObjectId("5a81a0de19a4ea2a8b119bab"),
    "Site" : 456,
    "Event" : "TheEvent",
    "SubEvent" : "FurtherDetails",
    "Level" : 3,
    "NewLevel": 2
}

/* 3 */
{
    "_id" : ObjectId("5a81a0de19a4ea2a8b119bac"),
    "Site" : 789,
    "Event" : "WorldEndingEvent",
    "SubEvent" : "RelevantDetails",
    "Level" : 5,
    "NewLevel": 4
}
</code></pre>

<p>To achieve this, I am using the switch case construct provided by MongoDB (but with no success):</p>

<pre><code>/*This does not work as Mongo does not recognize $Event in case statement*/
db.getCollection('Error_events_aggregated').aggregate([
    {
        $project: {
            Site: 1,
            Event: 1,
            SubEvent: 1,
            Level: 1,
            NewLevel: {
                $switch: {
                    branches: [
                        {
                            case: {$and: [
                                          {"$Event": {$eq: "AnEvent"}},
                                          {"$SubEvent": {$eq: "MoreDetails"}}
                                          ]},
                            then: 1
                        },
                        {
                            case: {$and: [
                                          {"$Event": {$eq: "TheEvent"}},
                                          {"$SubEvent": {$eq: "FurtherDetails"}}
                                          ]},
                            then: 2
                        },
                        {
                            case: {$and: [
                                          {"$Event": {$eq: "WorldEndingEvent"}},
                                          {"$SubEvent": {$eq: "RelevantDetails"}}
                                          ]},
                            then: 4
                        }
                    ],
                    default: "$Level"
                    }
                }
            }
        }
])
</code></pre>

<p>This doesn't work as MongoDB is not able to recognize $Event.</p>

<p>However, if I use a similar method (projection based on switch case) but using $gt (and similar) operators, then MongoDB doesn't have any problems identifying $Event...</p>

<pre><code>/*This works. Mongo recognizes $Event now, inside the case statement*/
db.getCollection('Error_events_aggregated').aggregate([
    {
        $project: {
            Site: 1,
            Event: 1,
            SubEvent: 1,
            Level: 1,
            NewLevel: {
                $switch: {
                    branches: [
                        {
                            case: {$gt: ["$Event", "V"]}, /*Matches WorldEndingEvent*/
                            then: 4 
                        },
                        {
                            case: {$gt: ["$Event", "S"]}, /*Matches TheEvent*/
                            then: 2
                        },
                        {
                            case: {$gt: ["$Event", "Am"]}, /*Matches AnEvent*/
                            then: 1
                        }
                    ],
                    default: "$Level"
                    }
                }
            }
        }
])
</code></pre>

<p>Can someone help me figure out what I am doing incorrectly? I tried reading through the docs, but all examples related to $switch as well as $cond cover only $gt and similar operators and doesn't cover equality-based operations.</p>

<p>I have tried using the {:} syntax for checking equality as well, but to no avail.</p>

