Aggregating an array of arrays in MongoDB/Mongoose<p>I am trying to aggregrate a collection into an array of documents. This is what I want it to look like.</p>

<pre><code>[
  {
    _id: ObjectId,
    points: [
      [longitude, latitude],
      [longitude, latitude],
      [longitude, latitude]
    ]
  },
  {
    _id: DifferentObjectId,
    points: [
      [longitude, latitude],
      [longitude, latitude],
      [longitude, latitude]
    ]
  }
]
</code></pre>

<p>Here is my model.</p>

<pre><code>const mongoose = require('mongoose');

const workSchema = new mongoose.Schema({
  fieldId: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'Field'
  },
  dayId: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'Day'
  },
  workerId: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'Worker'
  },
  contractorId: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'Contractor'
  },
  ownerId: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'Owner'
  },
  points: [{
    point: {
      type: {
        type: String,
        default: 'Point'
      },
      // longitude, latitude
      coordinates: [Number]
    },
    category: {
      type: String,
      enum: ['entry', 'exit', 'sos', 'in', 'out']
    },
    createdAt: {
      type: Date,
      default: Date.now
    }
  }]
},
{
  timestamps: true
});

workSchema.index({ 'points.point': '2dsphere' });

module.exports = mongoose.model('Work', workSchema);
</code></pre>

<p>Here is my aggregation logic.</p>

<pre><code>const work = await Work.aggregate([
    {
      $match: {
        contractorId: req.user.contractorId
      }
    },
    {
      $group: {
        _id: '$fieldId',
        points: {
          $push: '$points.point.coordinates'
        }
      }
    }
  ]);
</code></pre>

<p>This is what I end up getting. MAKE NOTE OF THE EXTRA LAYER OF ARRAY NESTING.</p>

<pre><code>    [
  {
    _id: ObjectId,
    points: [
      [
        [longitude, latitude],
        [longitude, latitude],
        [longitude, latitude]
      ]
    ]
  },
  {
    _id: DifferentObjectId,
    points: [
      [
        [longitude, latitude],
        [longitude, latitude],
        [longitude, latitude]
      ]
    ]
  }
]
</code></pre>

<p>I have tested grouping other fields, such as ownerId, and it works exactly as expected. I assume it has something to do with the fact that I am grouping from a field present on an array of embedded objects, but I have no clue how to fix it. Any help would be greatly appreciated!</p>

